import "../css/Assignment.css";
import React from "react";

const Assignment = () => {
  return (
    <div className="assignment">
      <img className="assignment_img" alt="assignment" src="https://res-1.cdn.office.net/eduassignmentsui/assets/6pu4deme.backend-provisioning.svg" />
      <h2 className="assignment_title">You need a class to start using assignments!</h2>
      <a href="/">Teachers: start here.</a>
      <p>Students: ask your teacher to create the class for you.</p>
    </div>
  );
};

export default Assignment;
